import Items from './Items';
import './App.css';
import Item from './Item';


function App() {

  return (
    <div className="App">
    <h1>
     Food App Menu
    </h1>
<table class="table">
  <thead class="thead-dark">
    <tr>
      <th scope="col"></th>
      <th scope="col">Name</th>
      <th scope="col">Price</th>
      <th scope="col">Add Item</th>
    </tr>
  </thead>
  <tbody>
{Items.map(function(NewItem){
  return (
    <Item 
    key= {NewItem.key}
    img= {NewItem.img}
    name= {NewItem.name}
    price={NewItem.price}
    />
  );
})}
</tbody>
</table>
    </div>
  );
}

export default App;
